import { Component } from '@angular/core';

@Component({
  selector: 'app-cajas',
  templateUrl: './cajas.component.html',
  styleUrls: ['./cajas.component.css']
})
export class CajasComponent {
  nuevaCaja = false;
  listaCajas = false;

}
